[{"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human BRCA1", "limit": 5}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?mnemonic ?recommendedName
WHERE {
  <http://purl.uniprot.org/uniprot/P38398> up:mnemonic ?mnemonic ;
                                            up:recommendedName ?recName .
  ?recName up:fullName ?recommendedName .
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "
SELECT (COUNT(DISTINCT ?ingredient) AS ?count)
WHERE {
  ?ingredient a ?type .
  FILTER(CONTAINS(STR(?type), "chemical") || CONTAINS(STR(?type), "ingredient") || CONTAINS(STR(?type), "compound"))
}
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT (COUNT(DISTINCT ?ingredient) AS ?count)
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?ingredient a schema:Ingredient .
}"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT (COUNT(DISTINCT ?disease) as ?count)
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           skos:closeMatch ?mondo .
  FILTER(STRSTARTS(STR(?mondo), "http://purl.obolibrary.org/obo/MONDO_"))
}"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX glytoucan: <http://www.glytoucan.org/glyco/owl/glytoucan#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX up: <http://purl.uniprot.org/core/>

SELECT DISTINCT ?position ?glycosylationType ?evidence
WHERE {
  ?protein a up:Protein ;
           up:mnemonic "GP1BB_HUMAN" .

  ?protein glycan:has_glycosylation_site ?site .
  ?site glycan:has_position ?position .
  OPTIONAL { ?site glycan:has_glycosylation_type ?glycosylationType }
  OPTIONAL { ?site glycan:has_evidence ?evidence }
}
ORDER BY ?position
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "glycosmos"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX glycoconjugate: <http://purl.jp/bio/12/glyco/conjugate#>
PREFIX sio: <http://semanticscience.org/resource/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?site ?position ?glycan ?glycanId
FROM <http://rdf.glycosmos.org/glycoprotein>
WHERE {
  ?protein a glycan:Glycoprotein ;
    rdfs:seeAlso <http://purl.uniprot.org/uniprot/P13224> ;
    glycoconjugate:glycosylated_at ?site .

  OPTIONAL { ?site faldo:location/faldo:position ?position }
  OPTIONAL { 
    ?site glycoconjugate:has_saccharide ?glycan .
  }
}
ORDER BY ?position
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX glycoconjugate: <http://purl.jp/bio/12/glyco/conjugate#>
PREFIX glytoucan: <http://www.glytoucan.org/glyco/owl/glytoucan#>
PREFIX sio: <http://semanticscience.org/resource/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?position ?glycanId ?siteUrl
FROM <http://rdf.glycosmos.org/glycoprotein>
FROM <http://rdf.glytoucan.org/core>
WHERE {
  ?protein a glycan:Glycoprotein ;
    rdfs:seeAlso <http://purl.uniprot.org/uniprot/P13224> ;
    glycoconjugate:glycosylated_at ?site .

  ?site faldo:location/faldo:position ?position .

  OPTIONAL { 
    ?site glycoconjugate:has_saccharide ?glycan .
    ?glycan glytoucan:has_primary_id ?glycanId .
  }

  BIND(STR(?site) AS ?siteUrl)
}
ORDER BY ?position
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "glycosmos", "sparql_query": "
PREFIX glycan: <http://purl.jp/bio/12/glyco/glycan#>
PREFIX glycoconjugate: <http://purl.jp/bio/12/glyco/conjugate#>
PREFIX glytoucan: <http://www.glytoucan.org/glyco/owl/glytoucan#>
PREFIX sio: <http://semanticscience.org/resource/>
PREFIX faldo: <http://biohackathon.org/resource/faldo#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT DISTINCT ?position ?p ?o
FROM <http://rdf.glycosmos.org/glycoprotein>
WHERE {
  ?protein a glycan:Glycoprotein ;
    rdfs:seeAlso <http://purl.uniprot.org/uniprot/P13224> ;
    glycoconjugate:glycosylated_at ?site .

  ?site faldo:location/faldo:position ?position ;
        ?p ?o .
}
ORDER BY ?position ?p
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "mediadive"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?medium ?label
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?medium a schema:CultureMedium ;
          rdfs:label ?label .
  ?label bif:contains "'LB'"
}
LIMIT 20"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?medium ?mediumLabel ?ingredient ?ingredientLabel ?gPerL
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?composition a schema:MediumComposition ;
               schema:partOfMedium ?medium ;
               schema:containsIngredient ?ingredient ;
               schema:gramsPerLiter ?gPerL .
  ?medium rdfs:label ?mediumLabel .
  ?ingredient rdfs:label ?ingredientLabel .
  FILTER(?medium = <https://purl.dsmz.de/mediadive/medium/381>)
}
ORDER BY DESC(?gPerL)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT DISTINCT ?ingredientLabel (SUM(?gPerL) as ?totalGPerL) (COUNT(?gPerL) as ?occurrences)
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?composition a schema:MediumComposition ;
               schema:partOfMedium <https://purl.dsmz.de/mediadive/medium/381> ;
               schema:containsIngredient ?ingredient ;
               schema:gramsPerLiter ?gPerL .
  ?ingredient rdfs:label ?ingredientLabel .
}
GROUP BY ?ingredientLabel
ORDER BY DESC(?totalGPerL)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "mediadive", "sparql_query": "PREFIX schema: <https://purl.dsmz.de/schema/>

SELECT ?ingredientLabel ?gPerL (COUNT(?gPerL) as ?frequency)
FROM <http://rdfportal.org/dataset/mediadive>
WHERE {
  ?composition a schema:MediumComposition ;
               schema:partOfMedium <https://purl.dsmz.de/mediadive/medium/381> ;
               schema:containsIngredient ?ingredient ;
               schema:gramsPerLiter ?gPerL .
  ?ingredient rdfs:label ?ingredientLabel .
}
GROUP BY ?ingredientLabel ?gPerL
ORDER BY ?ingredientLabel DESC(?frequency)"}}]
